INSERT INTO `groups` VALUES (1,27345,'Age (AGE)',0,'','en','',NULL),(1,27345,'Age (AGE)',0,'','fr','',NULL),(2,27345,'Sex (SEX)',1,'','en','',NULL),(2,27345,'Sex (SEX)',1,'','fr','',NULL),(3,27345,'Socio-Demographic Characteristics (SDC)',2,'Now some general background questions which will help us compare the health of people in Canada.','en','',NULL),(3,27345,'Socio-Demographic Characteristics (SDC)',2,'Maintenant je vais vous poser quelques questions générales qui nous aideront à comparer la santé des personnes qui vivent au Canada.','fr','',NULL),(4,27345,'Home Ownership (OWN)',3,'The next questions are about your current home.','en','',NULL),(4,27345,'Home Ownership (OWN)',3,'<div>Les questions suivantes portent sur votre domicile actuel.</div>','fr','',NULL),(5,27345,'Education (ED)',4,'<br />\r\n','en','',NULL),(5,27345,'Education (ED)',4,'','fr','',NULL),(6,27345,'Veteran Identifiers (VET)',5,'','en','',NULL),(6,27345,'Veteran Identifiers (VET)',5,'','fr','',NULL),(7,27345,'Height and Weight (HWT)',6,'','en','',NULL),(7,27345,'Height and Weight (HWT)',6,'','fr','',NULL),(8,27345,'Smoking (SMK)',7,'<div>\r\n	The first questions are about cigarette smoking. The term “cigarette” refers to cigarettes that are bought ready-made as well as those you roll yourself. Do not include cigars, cigarillos or pipes.</div>\r\n','en','',NULL),(8,27345,'Smoking (SMK)',7,'Les premières questions concernent la consommation de cigarettes. Le terme « cigarette » désigne les cigarettes achetées toutes faites et celles que vous roulez vous-mêmes. N’incluez pas les cigares, les cigarillos ou la pipe lorsque vous répondez à ces premières questions sur les cigarettes.<br />\r\n<br />\r\nPour cette section, lisez les instructions attentivement et suivez les consignes. Les non-fumeurs, les fumeurs réguliers et les fumeurs occasionnels peuvent suivre différentes trajectoires.','fr','',NULL),(9,27345,'Alcohol Use (ALC)',8,'<div>Now,  some questions about alcohol consumption. Alcohol includes red or white  wine, beer, spirit or liquor, and other kinds of alcohol including sake,  cider, sparkling wine, rose, etc.</div>\n<br />','en','',NULL),(9,27345,'Alcohol Use (ALC)',8,'<div>Maintenant,  je vais vous poser quelques questions sur la consommation d’alcool. Les  boissons alcoolisées incluent le vin rouge ou blanc, la bière, les  spiritueux ou les liqueurs alcoolisées et les autres types d’alcool tels  le saké, le cidre, le vin mousseux, le rosé, etc.</div>','fr','',NULL),(10,27345,'General Health (GEN)',9,'Next I am going to ask you some general questions about your health. By health, we mean not only the absence of disease or injury but also physical, mental, and social well-being.','en','',NULL),(10,27345,'General Health (GEN)',9,'<div>Maintenant,  je vais vous poser quelques questions générales sur votre santé. Par  santé, nous ne voulons pas seulement parler d’absence de maladie ou de  blessure, mais aussi de votre bien-être physique, mental et social.</div>','fr','',NULL),(11,27345,'Women\'s Health (WHO)',10,'<div>The next questions are about symptoms associated with menopause.</div>','en','',NULL),(11,27345,'Women\'s Health (WHO)',10,'<div>Les questions qui suivent porteront sur les symptômes associés à la ménopause.</div>','fr','',NULL),(12,27345,'Vision (VIS)',11,'<div>Now some questions about your vision...</div>\n<br />','en','',NULL),(12,27345,'Vision (VIS)',11,'<div>Maintenant, je vais vous poser quelques questions à propos de votre vision…</div>','fr','',NULL),(13,27345,'Hearing (HRG)',12,'Now some questions about your hearing....<br />','en','',NULL),(13,27345,'Hearing (HRG)',12,'','fr','',NULL),(14,27345,'Chronic Conditions Tracking (CCT)',13,'<div>Now I’d like to ask about any chronic health conditions which you may have. We  are interested in \"long-term conditions\" which are expected to last, or  have already lasted 6 months or more and that have been diagnosed by a  health professional.</div>\n<br />','en','',NULL),(14,27345,'Chronic Conditions Tracking (CCT)',13,'<div>Maintenant,  j’aimerais vous poser quelques questions sur des problèmes de santé  chroniques que vous pourriez avoir. Nous sommes intéressés aux  « problèmes à long terme » qui pourraient durer, ou qui ont déjà duré 6  mois ou plus et qui ont été diagnostiqués par un professionnel de la  santé.</div>','fr','',NULL),(15,27345,'Functional Status (FUL)',14,'','en','',NULL),(15,27345,'Functional Status (FUL)',14,'','fr','',NULL),(16,27345,'Basic Activities of Daily Living (ADL)',15,'<div>Now  I’d like to ask you about some basic activities of daily living.  Remember, these are activities that can be done without help, with some  help, or which you are unable to do.</div>','en','',NULL),(16,27345,'Basic Activities of Daily Living (ADL)',15,'<div>Maintenant,  j’aimerais vous poser des questions sur certaines activités de base de  la vie quotidienne. Rappelez-vous, ce sont des activités qui peuvent  être faites sans aide, avec un peu d’aide ou que vous êtes incapable de  faire.</div>','fr','',NULL),(44,27345,'Cognition (COG)',17,'<div>\r\n	Now, I am going to ask you to complete some tasks related to memory and concentration. Some of these tasks might seem difficult and some might seem easy, but that’s the way it is supposed to be. We don’t expect you to get them all right; we are asking everyone to do these tasks.</div>\r\n<div>\r\n	 </div>\r\n<div>\r\n	 </div>\r\n<br />\r\n','en','',NULL),(44,27345,'Cognition (COG)',17,'<p>\r\n	Maintenant, je vais vous demander de compléter certaines tâches qui sont liées à la mémoire et à la concentration. Certaines de ces tâches vous sembleront difficiles et d’autres faciles, mais c’est ainsi que cela doit être. Nous ne nous attendons pas à ce que vous ayez tout bon; nous demandons à tout le monde de faire ces tâches.</p>\r\n','fr','',NULL),(18,27345,'Depression (DEP)',18,'<div>\r\n	For the next few questions, please think about how you have felt <u>in the past week</u>, that is from <b> <script type=\"text/javascript\" charset=\"utf-8\">\r\n   var today = new Date();\r\n   var lastWeek = new Date(today.getTime()-1000*60*60*24*7);\r\n   var months=new Array(12);\r\n   months[0]=\"January\";\r\n   months[1]=\"February\";\r\n   months[2]=\"March\";\r\n   months[3]=\"April\";\r\n   months[4]=\"May\";\r\n   months[5]=\"June\";\r\n   months[6]=\"July\";\r\n   months[7]=\"August\";\r\n   months[8]=\"September\";\r\n   months[9]=\"October\";\r\n   months[10]=\"November\";\r\n   months[11]=\"December\";\r\n   var month = lastWeek.getMonth();\r\n   var year =  lastWeek.getFullYear();\r\n   var day =   lastWeek.getDate();\r\n   document.write(months[month]+\" \"+day+\" , \"+year);\r\n   document.write(\"<br />\");\r\n\r\n\r\n</script></b> to yesterday. I will first read you a question and then I will read you the answers from which you may choose. Please choose the answer that most applies to how you have felt over the past week.</div>\r\n<br />\r\n','en','',NULL),(18,27345,'Depression (DEP)',18,'<div>\r\n	Pour les prochaines questions, veuillez penser à comment vous vous êtes senti(e) au cours de la dernière semaine, c\'est-à-dire du <b> <script type=\"text/javascript\" charset=\"utf-8\">\r\n   var today = new Date();\r\n   var lastWeek = new Date(today.getTime()-1000*60*60*24*7);\r\n   var months=new Array(12);\r\n   months[0]=\"January\";\r\n   months[1]=\"February\";\r\n   months[2]=\"March\";\r\n   months[3]=\"April\";\r\n   months[4]=\"May\";\r\n   months[5]=\"June\";\r\n   months[6]=\"July\";\r\n   months[7]=\"August\";\r\n   months[8]=\"September\";\r\n   months[9]=\"October\";\r\n   months[10]=\"November\";\r\n   months[11]=\"December\";\r\n   var month = lastWeek.getMonth();\r\n   var year =  lastWeek.getFullYear();\r\n   var day =   lastWeek.getDate();\r\n   document.write(months[month]+\" \"+day+\" , \"+year);\r\n   document.write(\"<br />\");\r\n\r\n\r\n</script></b>à hier. Je vais commencer par vous lire la question et je vais lire les choix de réponse. Veuillez choisir la réponse qui convient le mieux à comment vous vous êtes senti(e) au cours de la dernière semaine.</div>\r\n','fr','',NULL),(19,27345,'Satisfaction with Life (SLS)',19,'<div>Now a series of statements that people might use to describe their satisfaction with their lives. Please tell me if you disagree or agree with each statement.</div>','en','',NULL),(19,27345,'Satisfaction with Life (SLS)',19,'<div>Voici  une série d’énoncés que les gens peuvent utiliser pour décrire leur  satisfaction à l\'égard de leur vie. Veuillez me dire si vous êtes en  désaccord ou en accord avec chaque énoncé.</div>','fr','',NULL),(20,27345,'Posttraumatic Stress Disorder (PSD)',20,'<div>In your life, have you ever had any experience that was so frightening, horrible, or upsetting that, <u>in the past month</u>, you…<b>READ LIST</b></div>','en','',NULL),(20,27345,'Posttraumatic Stress Disorder (PSD)',20,'Avez-vous déjà vécu un évènement si effrayant, horrible ou dérangeant, qu’<u>au cours du dernier mois</u> vous… <b>LIRE LA LISTE</b>\n<div style=\"text-align: justify; line-height: 110%;\"><span style=\"color: black;\"><b><br />\n</b></span></div>','fr','',NULL),(21,27345,'Social Networks (SN)',21,'<div>Now I’m going to ask you some questions about who lives in your household with you and what their relationship is to you. As well, I’m going to ask you about your children, whether they live with you now or not.</div>','en','',NULL),(21,27345,'Social Networks (SN)',21,'<div>Maintenant, je vais vous  poser quelques questions sur les personnes qui vivent dans logement et  sur leur lien avec vous. De plus, je vous poserai des questions sur vos  enfants, qu’ils habitent avec vous ou non.</div>','fr','',NULL),(22,27345,'Social Support - Availability (SSA)',22,'<div>Next are some questions about the support that is available to you.</div>\n<div> </div>\n<div> </div>\n<div>People  sometimes look to others for companionship, assistance or other types  of support. How often is each of the following kinds of support  available to you if you need it? <b>READ LIST OF STATEMENTS, CODE ONLY ONE RESPONSE PER STATEMENT</b></div>','en','',NULL),(22,27345,'Social Support - Availability (SSA)',22,'Voici maintenant quelques questions concernant le soutien auquel vous avez accès.<br />\n<br />\nNous nous tournons parfois vers les autres pour avoir de la compagnie,  de l’aide ou une autre forme de soutien. Dans quelle mesure avez-vous  accès aux types de soutien suivants quand vous en avez besoin?<b> LIRE LA LISTE D’ÉNONCÉS, ENREGISTRER UNE SEULE RÉPONSE PAR ÉNONCÉ</b>','fr','',NULL),(23,27345,'Social Participation (SPA) ',23,'<div>Now some questions about your social activities. </div>','en','',NULL),(23,27345,'Social Participation (SPA) ',23,'<div>Les questions qui suivent portent sur vos activités sociales.</div>','fr','',NULL),(24,27345,'Care Receiving 1/Formal Care (CR1)',24,'<div>Now  some questions on home care services you may have received because of a  health condition or limitation that affects your daily activities.  These services include health care, homemaker, or other support services  received at home. Please include only services provided by  professionals or paid workers. Exclude assistance from family, friends  or neighbors.</div>','en','',NULL),(24,27345,'Care Receiving 1/Formal Care (CR1)',24,'<div>Maintenant,  quelques questions sur les soins à domicile reçus en raison d’un  problème de santé ou de limitations affectant vos activités  quotidiennes. Par services à domicile, on entend des soins de santé, des  services d’entretien ménager ou d’autres services de soutien reçus à  domicile. Veuillez inclure seulement les services donnés par des  professionnels ou des travailleurs rémunérés. Exclure l’aide reçue de la  famille, d’amis ou de voisins</div>','fr','',NULL),(25,27345,'Care Receiving 2/Informal Care (CR2)',25,'<div>The  following questions are about different types of assistance that you  may have received because of a health condition or limitation that  affects your daily activities. Please include only assistance from  family, friends, or neighbors. Exclude assistance from paid workers or  volunteer organizations.</div>','en','',NULL),(25,27345,'Care Receiving 2/Informal Care (CR2)',25,'<div>Les  questions qui suivent portent sur les différents types d’aide reçue en  raison d’un problème de santé ou de limitations affectant vos activités  quotidiennes. Veuillez inclure seulement l’aide reçue de la famille,  d’amis ou de voisins. Exclure l’aide reçue par des travailleurs  rémunérés ou par des organismes bénévoles.</div>','fr','',NULL),(26,27345,'Care Giving (CAG)',26,'<div>The  following questions are about the types of assistance you may have  provided to other people because of a health condition or limitation. Please  only include assistance you provided to family members, friends and  other people living both inside and outside your household. Exclude any  assistance you provided as part of a <u>volunteer organization</u> or paid job.</div>','en','',NULL),(26,27345,'Care Giving (CAG)',26,'<div>Les  questions suivantes portent sur les formes d’aide que vous avez pu  apporter à des personnes en raison d\'un problème de santé ou de  limitations. Veuillez inclure seulement l’aide apportée à des membres de  votre famille, des amis et d’autres personnes vivant à l\'intérieur ou à  l\'extérieur de votre ménage. Exclure l’aide apportée comme <u>bénévole pour une organisation</u> ou dans le cadre d’un emploi rémunéré.</div>','fr','',NULL),(27,27345,'Injuries (INJ)',27,'<div>Now  some questions about injuries which occurred in the past 12 months, and  were serious enough to limit your normal activities.</div>','en','',NULL),(27,27345,'Injuries (INJ)',27,'<div>Maintenant,  j’aimerais vous poser quelques questions sur les blessures que vous  auriez pu subir au cours des 12 derniers mois et qui étaient  suffisamment graves pour limiter vos activités normales.</div>','fr','',NULL),(28,27345,'Falls and Consumer Products (FAL)',28,'<div>\r\n	You mentioned that you had at least one injury as a result of a fall. We would now like to ask you some questions about falls that you experienced in the last 12 months where you hurt yourself enough to limit some of your normal activities.</div>\r\n','en','',NULL),(28,27345,'Falls and Consumer Products (FAL)',28,'<div>\r\n	<b>[COMPLÉTER CE MODULE SEULEMENT SI INJ_2b=1</b><br />\r\n	<br />\r\n	<b>Vous avez indiqué avoir subi une blessure en raison d’une chute. Nous aimerions vous poser quelques questions sur des chutes que vous avez pu faire au cours des 12 derniers mois. Nous nous intéressons aux chutes où vous vous êtes suffisamment fait mal pour limiter certaines de vos activités normales.</b></div>\r\n','fr','',NULL),(29,27345,'Retirement Status (RET)',29,'<div>The following questions ask about your retirement experience.</div>','en','',NULL),(29,27345,'Retirement Status (RET)',29,'<div>Les prochaines questions portent sur votre expérience de la retraite.</div>','fr','',NULL),(30,27345,'Pre-Retirement Labur Force Participation (LFP)',30,'<div>\r\n	The following questions apply to the last job you had before retirement or partial retirement.</div>\r\n','en','',NULL),(30,27345,'Pre-Retirement Labur Force Participation (LFP)',30,'<div>\r\n	Les questions qui suivent portent sur le dernier emploi que vous avez occupé avant d\'être complètement ou partiellement retraité(e).</div>\r\n','fr','',NULL),(31,27345,'Labour Force (LBF)',31,'<div>\r\n	The next few questions concern your current and past employment activities.</div>\r\n<div>\r\n	 </div>\r\n','en','',NULL),(31,27345,'Labour Force (LBF)',31,'Les questions suivantes portent sur les activités de travail présentes et passées.<br />\r\n','fr','',NULL),(32,27345,'Retirement Planning (RPL)',32,'<span lang=\"EN-CA\" style=\"\">The next few questions ask about preparations for retirement. Some of these questions may not apply to you but we need to ask the same questions of everyone.</span>','en','',NULL),(32,27345,'Retirement Planning (RPL)',32,'Les prochaines questions portent sur la préparation à la retraite. Certaines de ces questions ne s’appliquent peut-être pas à vous, mais nous devons poser les mêmes questions à tout le monde.<br />\r\n<p>\r\n	 </p>\r\n','fr','',NULL),(33,27345,'Income (INC)',33,'<span lang=\"EN-CA\" style=\"\">This next section is about your standard of living.<span style=\"\">  </span>A person’s standard of living has been shown to have a relationship to their health. <span style=\"\"> </span>For this reason it is important that we have some understanding of the level of income that you and your family live on.<span style=\"\">  </span>As with all of the other information that you have shared, these answers are kept strictly confidential. </span>\n<p> </p>','en','',NULL),(33,27345,'Income (INC)',33,'La section suivante traite de votre niveau de vie. On a démontré que le niveau de vie d\'une personne avait un lien avec leur santé. Ainsi, il est important que nous ayons certaines informations sur votre revenu et celui de votre famille. Comme toutes les autres informations que vous nous avez donné, vos réponses seront strictement confidentielles.','fr','',NULL),(34,27345,'Administration Information (ADM)',34,'That completes our main interview. You have previously agreed to provide your health card number so that we can obtain information from provincial administrative databases and link it with the information you have shared with us during this interview. The information that we would get from the province includes your past and continuing use of health services such as visits to hospitals, clinics, and doctors’ offices.','en','',NULL),(34,27345,'Administration Information (ADM)',34,'L’entrevue est maintenant terminée. Vous aviez accepté au préalable de nous fournir votre numéro de carte santé (carte d’assurance-maladie au Québec) afin que nous puissions établir un lien entre les renseignements provenant des bases de données administratives provinciales et les informations que vous nous avez fournies pendant l’entrevue. Les renseignements que nous pourrions obtenir des autorités provinciales concernent notamment votre utilisation présente et passée des services de santé, comme les visites médicales effectuées à l’hôpital, dans les cliniques et dans les cabinets de médecins.','fr','',NULL),(35,27345,'Instrumental Activities of Daily Living (IAL)',16,'<div>\r\n	Now I’d like to ask you about some activities of daily living, activities that can be done without help, with some help or which you are unable to do. You may feel that some of these questions do not apply to you, but it is important that we ask the same questions of everyone.</div>\r\n<br />\r\n','en','',NULL),(35,27345,'Instrumental Activities of Daily Living (IAL)',16,'Maintenant, j’aimerais vous poser des questions sur certaines activités de la vie quotidienne, activités qui peuvent être faites sans aide, avec un peu d’aide ou que vous êtes incapable de faire. Il se peut que vous pensiez que certaines questions ne s’appliquent pas à vous, mais il est important que nous posions les mêmes questions à tout le monde.','fr','',NULL),(36,65716,'Introduction (INT)',0,'','en','',NULL),(36,65716,'Introduction (INT)',0,'','fr','',NULL),(37,35641,'Closing (CLS)',0,'<p>\r\n	<strong>That completes our main interview. There are just a few more pieces of information that I would like to collect before we end the call. </strong></p>\r\n','en','',NULL),(37,35641,'Closing (CLS)',0,'<p>\r\n	<strong>Voilà qui termine l’entrevue principale. Mais, avant de vous quitter, j’aurais encore quelques questions pour vous.</strong></p>\r\n','fr','',NULL),(38,75634,'Withdrawal',0,'<div>\r\n	<h2>\r\n		Participant indicates their desire to withdraw during interview</h2>\r\n</div>\r\n<p>\r\n	 </p>\r\n','en','',NULL),(38,75634,'Withdrawal',0,'<div>\r\n	<h2>\r\n		Participant indicates their desire to withdraw during interview</h2>\r\n</div>\r\n<p>\r\n	 </p>\r\n','fr','',NULL),(50,36656,'Closing (CLS)',0,'','en','',NULL),(55,78958,'Cognition (COG)',0,'<div>\n	Now, I am going to ask you to complete some tasks related to memory and concentration. Some of these tasks might seem difficult and some might seem easy, but that’s the way it is supposed to be. We don’t expect you to get them all right; we are asking everyone to do these tasks.</div>\n<div>\n	 </div>\n<div>\n	 </div>\n<br />\n','en','',NULL),(51,72154,'Introduction (INT)',0,'','en','',NULL),(52,72154,'Inclusion/Exclusion (INCL)',1,'','en','',NULL),(53,72154,'Consent (INT)',2,'','en','',NULL),(50,36656,'Closing (CLS)',0,'','fr','',NULL),(51,72154,'Introduction (INT)',0,'','fr','',NULL),(52,72154,'Inclusion/Exclusion (INCL)',1,'','fr','',NULL),(53,72154,'Consent (INT)',2,'','fr','',NULL),(54,67969,'HRF',0,'','en','',NULL),(55,78958,'Cognition (COG)',0,'<p>\n	Maintenant, je vais vous demander de compléter certaines tâches qui sont liées à la mémoire et à la concentration. Certaines de ces tâches vous sembleront difficiles et d’autres faciles, mais c’est ainsi que cela doit être. Nous ne nous attendons pas à ce que vous ayez tout bon; nous demandons à tout le monde de faire ces tâches.</p>\n','fr','',NULL),(54,67969,'HRF',0,'','fr','',NULL),(40,65716,'End of introductoin',1,'','fr','',NULL),(40,65716,'End of introduction',1,'','en','',NULL);
