INSERT INTO `questions` VALUES (1,0,27345,1,'D','AGE_DOB_TRM','<p>\r\n	For some of the questions I’ll be asking, I need to know your exact date of birth.<br />\r\n	 </p>\r\n<p>\r\n	<strong>Please enter the date in the following order: YEAR, MONTH, DAY</strong></p>\r\n','','<b>DK/RF NOT ALLOWED</b><br />\r\n','N','Y',0,'en',0,0,NULL),(1,0,27345,1,'D','AGE_DOB_TRM','<p>\r\n	Pour certaines questions que je dois vous poser, j’ai besoin de connaître votre date de naissance exacte.</p>\r\n<p>\r\n	<strong>Veuillez inscrire votre date de naissance dans l\'ordre suivant: ANNÉE, MOIS, JOUR</strong></p>\r\n','','<b>NSP / RF NON PERMIS</b>','N','Y',0,'fr',0,0,NULL),(2,0,27345,1,'Y','AGE_CALC_TRM','Is your age <script type=\"text/javascript\" charset=\"utf-8\">\r\n\r\n  \r\n          var a = \"{INSERTANS:27345X1X1}\";\r\n          var b = a.substring(6); \r\n          var born = parseInt(b);\r\n          var c = new Date();\r\n          var currentYear = c.getFullYear();\r\n          var age = currentYear - born;\r\n          document.write(age);\r\n\r\n</script>? Is that correct?<br />\r\n','','<b>DK/RF NOT ALLOWED</b><br />\r\n','N','Y',1,'en',0,0,NULL),(2,0,27345,1,'Y','AGE_CALC_TRM','Alors, vous avez <script type=\"text/javascript\" charset=\"utf-8\">\r\n\r\n  \r\n          var a = \"{INSERTANS:27345X1X1}\";\r\n          var b = a.substring(6); \r\n          var born = parseInt(b);\r\n          var c = new Date();\r\n          var currentYear = c.getFullYear();\r\n          var age = currentYear - born;\r\n          document.write(age);\r\n\r\n</script>? Est-ce exact?<br />\r\n','','<b>NSP / RF NON PERMIS</b>','N','Y',1,'fr',0,0,NULL),(3,0,27345,1,'N','AGE_ASK_YR_TRM','Is your age <script type=\"text/javascript\" charset=\"utf-8\">\r\n\r\n          var a = \"{INSERTANS:27345X1X1}\";\r\n          var x = a.substring(6);   //year\r\n          var y = a.substring(3,5); //month\r\n          var z = a.substring(0,2); //day\r\n          var year = parseInt(x);\r\n          var month = parseInt(y);\r\n          var day = parseInt(z);\r\n        \r\n          var c = new Date();\r\n          var currentYear = c.getFullYear();\r\n          var currentMonth = c.getMonth() + 1;\r\n          var currentDay = c.getDate();\r\n         \r\n          var ydiff = currentYear - year;\r\n          var mdiff = currentMonth - month;\r\n          var ddiff = currentDay - day;\r\n\r\n          if (mdiff < 0){\r\n               ydiff--;\r\n          }\r\n          else if (mdiff == 0){\r\n             \r\n             if (ddiff < 0){\r\n              ydiff--;\r\n             }\r\n             else if (ddiff > 0){\r\n              //ydiff--;\r\n             }\r\n          }\r\n          else if (mdiff > 0){\r\n             ydiff--;\r\n          }\r\n         \r\n          var age = ydiff;\r\n          document.write(age);\r\n\r\n$(document).ready(function() {\r\n  $(\'#answer27345X1X3\').val(age);\r\n});\r\n\r\n</script>? Is that correct?<br />\r\n','','<b>RECORD EXACT AGE (IN YEARS)</b><br />\r\n','N','Y',3,'en',0,0,NULL),(3,0,27345,1,'N','AGE_ASK_YR_TRM','Alors, vous avez <script type=\"text/javascript\" charset=\"utf-8\">\r\n\r\n          var a = \"{INSERTANS:27345X1X1}\";\r\n          var x = a.substring(6);   //year\r\n          var y = a.substring(3,5); //month\r\n          var z = a.substring(0,2); //day\r\n          var year = parseInt(x);\r\n          var month = parseInt(y);\r\n          var day = parseInt(z);\r\n        \r\n          var c = new Date();\r\n          var currentYear = c.getFullYear();\r\n          var currentMonth = c.getMonth() + 1;\r\n          var currentDay = c.getDate();\r\n         \r\n          var ydiff = currentYear - year;\r\n          var mdiff = currentMonth - month;\r\n          var ddiff = currentDay - day;\r\n\r\n          if (mdiff < 0){\r\n               ydiff--;\r\n          }\r\n          else if (mdiff == 0){\r\n             \r\n             if (ddiff < 0){\r\n              ydiff--;\r\n             }\r\n             else if (ddiff > 0){\r\n              //ydiff--;\r\n             }\r\n          }\r\n          else if (mdiff > 0){\r\n             ydiff--;\r\n          }\r\n         \r\n          var age = ydiff;\r\n          document.write(age);\r\n\r\n$(document).ready(function() {\r\n  $(\'#answer27345X1X3\').val(age);\r\n});\r\n\r\n</script>? Est-ce exact?','','<b>INSCRIRE L’ÂGE EXACT (EN ANNÉE)</b>','N','Y',3,'fr',0,0,NULL),(4,0,27345,1,'X','AGE_DISQ','<script type=\"text/javascript\" language=\"Javascript\">;\r\n\r\n$(document).ready(function(){\r\n\r\n     $(\'.submit\').click(function(){\r\n          var v = document.getElementById(\'answer27345X110X1200\');\r\n          var c = parseInt(v.value);\r\n          if (c < 45 | c > 85){\r\n             window.location=\"http://www.limesurvey.org\";\r\n             return false;\r\n     });//click function\r\n\r\n});//end of document ready              \r\n\r\n</script>Because you are less than 45 years old/older than 88 years of age, you are not eligible to participate in the Canadian Longitudinal Study on Aging. Thank you for your time. Click on End Call.<br />\r\n','','<b>END INTERVIEW AND RECORD CALL RESULT</b><br />\r\n<br />\r\n','N','N',4,'en',0,0,'((regexMatch(\"/^([1-9]|[1][0-9]|[2][0-9]|[3][0-9]|[4][0-4]|[8][9]|[9][0-9])$/\",27345X1X3.NAOK)))'),(4,0,27345,1,'X','AGE_DISQ','Puisque que vous avez moins de 45 ans / ou plus de 88 ans, vous n’êtes pas éligible pour participer à l’Étude longitudinale canadienne sur le vieillissement. Merci pour le temps que vous nous avez accordé.<br />\r\n','','<b>[DISQUALIFIER SI L’ÂGE EST <45 OU >88]<br />\r\nTERMINER L’ENTREVUE ET INSCRIRE LE RÉSULTAT DE L’APPEL</b>','N','N',4,'fr',0,0,'((regexMatch(\"/^([1-9]|[1][0-9]|[2][0-9]|[3][0-9]|[4][0-4]|[8][9]|[9][0-9])$/\",27345X1X3.NAOK)))'),(6,0,27345,3,'L','SDC_COB_TRM','In what country were you born?<br />\r\n','','<b>DO NOT READ RESPONSES, CODE ONLY ONE RESPONSE</b><br />\r\n','N','Y',0,'en',0,0,NULL),(6,0,27345,3,'L','SDC_COB_TRM','Da