intment for a follow-up interview. I will try again another time or, you can contact us on our toll free line at 1-866-999-8303. Have a good day/ afternoon/ evening.<br />\r\n','','<div>\r\n	<b><b>LEAVE THE FOLLOWING MESSAGE AFTER THE SECOND CALL ATTEMPT</b><br />\r\n	SABRETOOTH SCHEDULE CALLBACK BASED ON ASSIGNMENT STATUS </b></div>\r\n<br />\r\n','N','N',5,'en',0,0,'((65716X36X996.NAOK == \"ANSWERING_MACHING_UNKNOWN_PARTICIPANT_HOUSEHOLD\"))'),(999,0,65716,36,'L','INT_ANSW_CCHS_TRM','Hello, may I please speak with <strong>{TOKEN:FIRSTNAME}</strong> <strong>{TOKEN:LASTNAME}</strong><b>?</b><br />\r\n','','','N','Y',7,'en',0,0,'((65716X36X996.NAOK == \"CALL_ANSWERED\"))'),(1000,0,65716,36,'L','INT_TKFOLUP_CCHS_TRM','Hello, Mr./ Ms. <strong>{TOKEN:LASTNAME}</strong><span>.My name is <strong>{TOKEN:ATTRIBUTE_8}</strong>, and I am calling from the Canadian Longitudinal Study on Aging, also known as the CLSA. You completed a 20-minute interview on <strong>{TOKEN:ATTRIBUTE_10}</strong>, at that time you agreed to be contacted for a follow-up interview. I’m calling you today because it has been 12-18 months since that initial interview and is now time for your follow-up interview, which will take approximately 1 hour.</span><br />\r\n<br />\r\nAre you interested in taking the follow-up survey at this time?<br />\r\n<br />\r\n<br />\r\n','','','N','Y',8,'en',0,0,'((65716X36X999.NAOK == \"AVAILABLE\"))'),(1001,0,65716,36,'L','INT_BKAPPMT_CCHS_TRM','Can we book an appointment at time that suits your schedule?<br />\r\n','','','N','Y',9,'en',0,0,'((65716X36X1000.NAOK == \"NO\"))'),(1002,0,65716,36,'M','INT_RECAVAI_CCHS_TRM','<div>\r\n	Alright, we will call back again at another time to try and book an appointment for your</div>\r\nfollow-up interview.<br />\r\n','','<div>\r\n	<b>“Which day of the week usually works best for you?” </b></div>\r\n<div>\r\n	<b>and “Would you prefer Morning, Afternoon or Evening?” </b></div>\r\n<div>\r\n	<b> </b></div>\r\n<b>Record availability in Sabretooth – <span>END CALL</span></b><br />\r\n','N','N',10,'en',0,0,'((65716X36X1001.NAOK == \"NO\"))'),(1003,0,65716,36,'L','INT_CONFADD_CCHS_TRM','<p>\r\n	Before we begin the interview there are just a few Administrative questions or housekeeping we need to take care of.<span> </span><br />\r\n	<br />\r\n	I’d like to confirm the <b><u>MAILING</u></b> address that we have on file so future correspondence can be mailed to you. We have your mailing address as<br />\r\n	<br />\r\n	<b>{TOKEN:ATTRIBUTE_1},<br />\r\n	{TOKEN:ATTRIBUTE_2},<br />\r\n	{TOKEN:ATTRIBUTE_3},<br />\r\n	{TOKEN:ATTRIBUTE_4}.</b><br />\r\n	<br />\r\n	Is this correct?</p>\r\n','','<strong><em><u>INTERVIEWER NOTE</u>:</em> IF PARTICIPANT RESPONDS DOES NOT WANT TO PARITICIPATE, PLEASE CONFIRM IF THEY WISH TO WITHDRAW FROM THE CLSA.  IF THEY WISH TO WITHDRAW CLICK THE \"WITHDRAW NOW\" BUTTON AND PROCEED THROUGH THE WITHDRAWAL SCRIPT.</strong>','N','Y',11,'en',0,0,'(((!is_empty(TOKEN:ATTRIBUTE_18) && (TOKEN:ATTRIBUTE_18 == \"0\"))) and (65716X36X1000.NAOK == \"YES\"))'),(1004,0,65716,36,';','INT_CORRADD_CCHS_TRM','Could I get your correct <b><u>MAILING</u></b> address, please?<br />\r\n','','<b>RECORD CORRECT ADDRESS AND REPEAT BACK TO THE PARTICIPANT TO CONFIRM ACCURACY</b><br />\r\n','N','N',12,'en',0,0,'(((!is_empty(TOKEN:ATTRIBUTE_18) && (TOKEN:ATTRIBUTE_18 == \"0\"))) and (65716X36X1003.NAOK == \"NO\"))'),(1005,1004,65716,36,';','_TRM','',NULL,NULL,'N',NULL,1,'en',1,0,NULL),(1006,1004,65716,36,';','INT_CORRADD_ST_CCHS','RECORD STREET NUMBER & STREET NAME',NULL,NULL,'N',NULL,1,'en',0,0,NULL),(1007,1004,65716,36,';','INT_CORRADD_APT_CCHS','RECORD APT NUMBER (IF APPLICABLE)',NULL,NULL,'N',NULL,4,'en',0,0,NULL),(1008,1004,65716,36,';','INT_CORRADD_CT_CCHS','RECORD CITY',NULL,NULL,'N',NULL,2,'en',0,0,NULL),(1009,1004,65716,36,';','INT_CORRADD_PR_CCHS','RECORD PROVINCE',NULL,NULL,'N',NULL,5,'en',0,0,NULL),(1010,1004,65716,36,';','INT_CORRADD_PC_CCHS','RECORD POSTAL CODE',NULL,NULL,'N',NULL,3,'en',0,0,