 \"0\") and ((!is_empty(TOKEN:ATTRIBUTE_18) && (TOKEN:ATTRIBUTE_18 == \"0\"))) and (65716X36X1013.NAOK == \"NO\")) or (((is_empty(TOKEN:ATTRIBUTE_11) || (TOKEN:ATTRIBUTE_11 != \"0\"))) and ((!is_empty(TOKEN:ATTRIBUTE_18) && (TOKEN:ATTRIBUTE_18 == \"0\"))) and (65716X36X1013.NAOK == \"YES\") and (65716X36X1014.NAOK != \"\"\"\"))'),(1016,0,65716,36,'L','INT_ALTCNT_CCHS_TRM','In case we are unable to contact you directly at some point in the future, I would like to ask you for contact information of two people that would be able to connect us with you. This would be someone who will always know where you are should you move or be away from home for any length of time.\r\n<p>\r\n	 </p>\r\n','','<strong>[ASK IF ALTERNATE CONTACT INFO IS NOT PROVIDED IN DATABASE] </strong>','N','Y',23,'en',0,0,'(((!is_empty(TOKEN:ATTRIBUTE_11) && (TOKEN:ATTRIBUTE_11 == \"0\"))) and (regexMatch(\"/^.{0,0}$/\",65716X36X996.NAOK) or 65716X36X996.NAOK != \"RING_OUT\") and (65716X36X999.NAOK == \"AVAILABLE\") and (65716X36X1001.NAOK != \"NO\") and (65716X36X1003.NAOK != \"REFUSES_CONFIRMED_ADDRESS_OR_TO_PARTICIPATE\") and (65716X36X1011.NAOK != \"REFUSES_CONFIRMED_ADDRESS_OR_TO_PARTICIPATE\")) or (((!is_empty(TOKEN:ATTRIBUTE_11) && (TOKEN:ATTRIBUTE_11 == \"0\"))) and (65716X36X1011.NAOK == \"NO\" or 65716X36X1011.NAOK == \"YES\")) or (((!is_empty(TOKEN:ATTRIBUTE_11) && (TOKEN:ATTRIBUTE_11 == \"0\"))) and (65716X36X1013.NAOK == \"NO\")) or (((!is_empty(TOKEN:ATTRIBUTE_11) && (TOKEN:ATTRIBUTE_11 == \"0\"))) and (65716X36X1014.NAOK != \"\"\"\"))'),(1017,0,65716,36,'L','CLS_ALT1TEL_CCHS_TRM','Great! Is <strong>{TOKEN:ATTRIBUTE_12}</strong> still reachable at <strong>{TOKEN:ATTRIBUTE_14}</strong>?','','','N','Y',20,'en',0,0,'(((!is_empty(TOKEN:ATTRIBUTE_18) && (TOKEN:ATTRIBUTE_18 == \"0\"))) and (65716X36X1015.NAOK == \"YES\"))'),(1018,0,65716,36,'S','CLS_ALT1TELC_CCHS_TRM','OK, could I have <strong>{TOKEN:ATTRIBUTE_12}</strong> current telephone number?\r\n<p>\r\n	 </p>\r\n','','<strong><em>RECORD TELEPHONE NUMBER AND READ BACK TO THE PARTICIPANT TO VERIFY ACCURACY</em></strong>\r\n<p>\r\n	 </p>\r\n','N','Y',21,'en',0,0,'(((!is_empty(TOKEN:ATTRIBUTE_18) && (TOKEN:ATTRIBUTE_18 == \"0\"))) and (65716X36X1017.NAOK == \"NO\"))'),(1005,1004,65716,36,';','_TRM','',NULL,NULL,'N','',1,'fr',1,0,NULL),(996,0,65716,36,'L','INT_CDCALL_CCHS_TRM','','','<p>\r\n	<strong>INSCRIRE L’UN DES CODES SUIVANTS :</strong></p>\r\n','N','Y',1,'fr',0,0,NULL),(1006,1004,65716,36,';','INT_CORRADD_ST_CCHS','INSCRIRE LE NUMÉRO ET LE NOM DE LA RUE',NULL,NULL,'N','',1,'fr',0,0,NULL),(997,0,65716,36,'X','INT_AMCHNP_CCHS_TRM','Bonjour / bonsoir, ce message s’adresse à M. / Mme <strong>{TOKEN:FIRSTNAME} {TOKEN:LASTNAME}</strong>.  Mon nom est <strong>{TOKEN:ATTRIBUTE_8}</strong> <strong>{TOKEN:ATTRIBUTE_9}. </strong>Je vous appelle au sujet de l’Étude longitudinale canadienne sur le vieillissement ou ÉLCV. Vous avez complété une entrevue de 20 minutes le <strong>{TOKEN:ATTRIBUTE_10}. </strong>Lors de cet appel, vous avez accepté de participer à une entrevue de suivi.  J’appelle aujourd’hui dans le but de fixer un rendez-vous pour cette entrevue. J’essaierai de vous rejoindre à un autre moment ou, si vous préférez, vous pouvez communiquer avec nous à notre numéro sans frais, le 1 866 999-8303. Bonne journée / bon après-midi / bonne soirée.<br />\r\n','','<strong>PRÉVOIR UN</strong> <strong>AUTRE MOMENT POUR RAPPELER LE PARTICIPANT SELON LE STATUT DU CAS DANS SABRETOOTH</strong>.<br />\r\n','N','N',3,'fr',0,0,'((65716X36X996.NAOK == \"ANSWERING_MACHING_PARTICIPANT_HOUSEHOLD\"))'),(1007,1004,65716,36,';','INT_CORRADD_APT_CCHS','INSCRIRE LE NUMÉRO D’APP. (S’IL Y A LIEU)',NULL,NULL,'N','',4,'fr',0,0,NULL),(998,0,65716,36,'X','INT_AMCHNUN_CCHS_TRM','Bonjour / bonsoir, je m’appelle <strong>{TOKEN:ATTRIBUTE_8}</strong> de l’Étude longitudinale canadienne sur le vieillissement, ou l’ÉLCV. Je tente actuellement de joindre une personne de votre ménage qui a complété une entrevue de 20 minutes avec nous le <strong>{TOKEN:ATTRIBUTE_10}</strong>. J’appelle aujourd’hui dans le but de fixer un rendez-vous pour une entrevue de suivi. J’essaierai de vous rejoindre à un autre moment. Aussi, vous pouvez communiquer avec nous à notre numéro sans frais, le 1 866 999-8303. Bonne journée / bon après-midi / bonne soirée.<br />\r\n','','<strong>LAISSER LE MESSAGE SUIVANT APRÈS LA DEUXIÈME TENTATIVE D’APPEL.</strong><br />\r\n<strong>PRÉVOIR UN</strong> <strong>AUTRE MOMENT POUR RAPPELER LE PARTICIPANT SELON LE STATUT DU CAS DANS SABRETOOTH</strong>.<br />\r\n','N','N',5,'fr',0,0,'((65716X36X996.NAOK == \"ANSWERING_MACHING_UNKNOWN_PARTICIPANT_HOUSEHOLD\"))'),(1008,1004,65716,36,';','INT_CORRADD_CT_CCHS','INSCRIRE LA VILLE ',NULL,NULL,'N','',2,'fr',0,0,NULL),(999,0,65716,36,'L','INT_ANSW_CCHS_TRM','Bonjour / bonsoir, puis-je parler à <strong>{TOKEN:FIRSTNAME}</strong> <strong>{TOKEN:LASTNAME}?</strong>','','','N','Y',7,'fr',0,0,'((65716X36X996.NAOK == \"CALL_ANSWERED\"))'),(1009,1004,65716,36,';','INT_CORRADD_PR_CCHS','INSCRIRE LA PROVINCE ',NULL,NULL,'N','',5,'fr',0,0,NULL),(1000,0,65716,36,'L','INT_TKFOLUP_CCHS_TRM','Bonjour / bonsoir M. / Mme <strong>{TOKEN:LASTNAME}. </strong> Mon nom est <strong>{TOKEN:ATTRIBUTE_8}. </strong>Je vous appelle au sujet de l’Étude longitudinale canadienne sur le vieillissement ou l’ÉLCV. Vous avez complété une entrevue de 20 minutes le <strong>{TOKEN:ATTRIBUTE_10}</strong>. Lors de cet appel, vous avez accepté qu’on communique avec vous pour faire une entrevue de suivi. J’appelle aujourd’hui, car vous avez complété votre première entrevue il y a 12 à 18 mois et il est maintenant temps de faire une entrevue de suivi. Cette entrevue prendra environ une heure.                        \r\n<p>\r\n	Êtes-vous intéressé(e) à compléter le questionnaire de suivi maintenant?<br />\r\n	<br />\r\n	<br />\r\n	 </p>\r\n','','','N','Y',8,'fr',0,0,'((65716X36X999.NAOK == \"AVAILABLE\"))'),(1010,1004,65716,36,';','INT_CORRADD_PC_CCHS','INSCRIRE LE CODE POSTAL ',NULL,NULL,'N','',3,'fr',0,0,NULL),(1001,0,65716,36,'L','INT_BKAPPMT_CCHS_TRM','Pouvons-nous fixer un rendez-vous au moment qui vous convient le mieux?','','','N','Y',9,'fr',0,0,'((65716X36X1000.NAOK == \"NO\"))'),(1002,0,65716,36,'M','INT_RECAVAI_CCHS_TRM','Très bien, nous allons vous rappeler à un autre moment pour tenter de fixer un rendez-vous pour votre entrevue de suivi. ','','<p>\r\n	<strong>« Quelle période de la journée vous conviendrait le mieux? » et « Préférez-vous qu’on vous appelle le matin, l’après-midi ou en soirée? »</strong></p>\r\n<p>\r\n	<strong>Inscrire les disponibilités dans Sabretooth – TERMINER L’APPEL</strong><br />\r\n	 </p>\r\n','N','N',10,'fr',0,0,'((65716X36X1001.NAOK == \"NO\"))'),(1003,0,65716,36,'L','INT_CONFADD_CCHS_TRM','<p>\r\n	Avant de commencer, je dois vous poser quelques questions administratives.                        </p>\r\n<p>\r\n	J’aimerais confirmer votre adresse <strong><u>POSTALE</u></strong> pour que nous puissions vous faire parvenir des documents au besoin. L’adresse que nous avons est <br />\r\n	<br />\r\n	<strong>{TOKEN:ATTRIBUTE_1},<br />\r\n	{TOKEN:ATTRIBUTE_2},<br />\r\n	{TOKEN:ATTRIBUTE_3},<br />\r\n	{TOKEN:ATTRIBUTE_4} </strong><br />\r\n	<br />\r\n	Est-ce exact?<br />\r\n	 </p>\r\n','','<p>\r\n	<strong><em><u>NOTE À L’INTERVIEWEUR :</u></em></strong><strong> SI LE PARTICIPANT RÉPOND « NE SOUHAITE PAS PARTICIPER À L’ÉTUDE », <u>CONFIRMER</u> QU’IL/ELLE SOUHAITE SE RETIRER DE L’ÉLCV. S’IL/ELLE SOUHAITE SE RETIRER DE L’ÉTUDE, CLIQUER SUR « SE RETIRER MAINTENANT »  ET SUIVRE LE SCÉNARIO DE RETRAIT.</strong></p>\r\n','N','Y',11,'fr',0,0,'(((!is_empty(TOKEN:ATTRIBUTE_18) && (TOKEN:ATTRIBUTE_18 == \"0\"))) and (65716X36X1000.NAOK == \"YES\"))'),(1004,0,65716,36,';','INT_CORRADD_CCHS_TRM','<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:TargetScreenSize>800x600</o:TargetScreenSize>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:Vi