G.</strong>\r\n<p>\r\n	 </p>\r\n','N','Y',30,'en',0,0,'((65716X36X1024.NAOK == \"YES\"))'),(1025,0,65716,36,'L','INT_HAVHOUR_CCHS_TRM','Est-ce que vous disposez d’environ une heure pour participer à la première entrevue maintenant? ','','<strong>S’IL EST NÉCESSAIRE DE PRENDRE RENDEZ-VOUS, NE PAS HÉSITER À DEMANDER DES PRÉCISIONS TELLES QUE « HABITUELLEMENT, QUEL EST LE MEILLEUR MOMENT DE LA JOURNÉE POUR VOUS? » ou « PRÉFÉREZ-VOUS LE MATIN, L’APRÈS-MIDI OU LE SOIR? » – FIXER LA DATE ET L’HEURE DU RENDEZ-VOUS  SELON LE PREMIER MOMENT DISPONIBLE.</strong>','N','Y',30,'fr',0,0,'((65716X36X1024.NAOK == \"YES\"))'),(1026,0,65716,36,'X','INT_GETSTRT_CCHS_TRM','Great, let’s get started! ','','','N','N',31,'en',0,0,'((65716X36X1025.NAOK == \"YES\"))'),(1026,0,65716,36,'X','INT_GETSTRT_CCHS_TRM','Très bien, allons-y! ','','','N','N',31,'fr',0,0,'((65716X36X1025.NAOK == \"YES\"))'),(1704,1600,27345,44,'M','GARD','Jardin','','','N','',8,'fr',0,0,NULL),(1705,1628,27345,44,'M','HAT','Chapeau','','','N','',9,'fr',0,0,NULL),(1028,0,35641,37,'L','CLS_PROXY_CCHS_TRM','<b>That completes our main interview. There are just a few more pieces of information that I would like to collect before we end the call.<br />\r\n<br />\r\n<b>At this time we would like to ask you if you would like to identify a person who would be able to act as a Proxy for your interviews if at any time in the future you are not able to respond to the interview questions on your own behalf?  </b></b>','','<p>\r\n	<strong>INTERVIEW NOTE: A proxy is defined as a legally-appointed person or other person who could make decisions for them if they were no longer able to make decisions in the future</strong></p>\r\n','N','Y',0,'en',0,0,'((TOKEN:ATTRIBUTE_1 >= \"70\"))'),(1029,0,35641,37,'L','CLS_PROXYPCK_CCHS_TRM','Thank you very much, please complete the proxy information and consent form enclosed in package mailed to you and send it back to us using the pre-paid self-addressed envelope also included in the package. ','','<strong>INTERVIEWER – ASK THE PARTICIPANT TO CONFIRM THAT THEY STILL HAVE THE PROXY INFORMAITON PACKAGE IN THEIR POSSESSION</strong>\r\n<p>\r\n	 </p>\r\n','N','Y',1,'en',0,0,'((TOKEN:ATTRIBUTE_1 >= \"70\") and (35641X37X1028.NAOK == \"YES\"))'),(1030,0,35641,37,'L','CLS_SECADD_CCHS_TRM','<script type=\"text/javascript\" charset=\"utf-8\">\r\n\r\n  \r\n          var a = \"{TOKEN:ATTRIBUTE_1}\";\r\n          var b = parseInt(a);\r\n          if (b < 70){\r\n            document.write(\"<b>\");\r\n            document.write(\"That completes our main interview. \");\r\n            document.write(\"There are just a few more pieces of information that I would like to collect before we end the call.. \")\r\n            document.write(\"</b>\");\r\n            document.write(\"<br />\");\r\n            document.write(\"<br />\");\r\n          }\r\n        \r\n    \r\n\r\n</script>\r\n<p>\r\n	Some of our participants have secondary homes that they live at either in the summer or the winter.  We would like to collect the information on these secondary addresses so that we can be sure that we can reach you at any time for correspondence or follow-up interviews. </p>\r\n<p>\r\n	Do you have a secondary address that you would like to provide us the information for? </p>\r\n','','','N','Y',2,'en',0,0,'((35641X37X1028.NAOK == \"NO\")) or ((35641X37X1029.NAOK == \"NOTREQUIRESNEWPROXYPACKAGE\" or 35641X37X1029.NAOK == \"REQUIRESNEWPROXYPACKAGE\")) or (((!is_empty(TOKEN:ATTRIBUTE_1) && (TOKEN:ATTRIBUTE_1 < \"70\"))))'),(1031,0,35641,37,'Q','CLS_4a','Great, please go ahead starting with the <u>mailing</u> address, then the telephone number. ','','<strong>RECORD ADDRESS & TELEPHONE AND REPEAT BACK TO THE PARTICIPANT TO CONFIRM ACCURACY</strong>','N','Y',3,'en',0,0,'((35641X37X1030.NAOK == \"YES\"))'),(1032,0,35641,37,'M','CLS_SECADDMO_CCHS_TRM','Can you tell me what month(s) out of the year this address is active? ','','<p>\r\n	<strong>MULTIPLE MONTHS ALLOWED</strong></p>\r\n<p>\r\n	<strong>RECORD CORRECT ADDRESS AND REPEAT BACK TO THE PARTICIPANT TO CONFIRM ACCURACY</strong></p>\r\n<p>\r\n	 </p>\r\n','N','Y',4,'en',0,0,'((35641X37X1030.NAOK == \"YES\"))'),(1033,0,35641,37,'X','CLS_THANK_CCHS_TRM','Mr./ Ms. <b>{TOKEN:LASTNAME}</b>, thank you for your time today. One of our researchers will contact you in about 12 to 18 months to schedule another interview.  \r\n<p>\r\n	 </p>\r\n<p style=\"margin-left: 1in;\">\r\n	 </p>\r\n<script type=\"text/javascript\" charset=\"utf-8\">\r\n\r\n  \r\n          var a = \"{TOKEN:ATTRIBUTE_2}\";\r\n          var b = parseInt(a);\r\n          if (b == 0){\r\n            document.write(\"<b>\");\r\n            document.write(\"And please remember to mail us your signed consent form so that we may contact you again. \");\r\n            document.write(\"We also can’t use the information you have given us today if we don’t receive it. \")\r\n            document.write(\"</b>\");\r\n            document.write(\"<br />\");\r\n            document.write(\"<br />\");\r\n          }\r\n        \r\n    \r\n\r\n</script>Thank you again for taking the time to participant in this very important program of research. Have a good day/ afternoon/ evening.\r\n<p>\r\n	 </p>\r\n','','','N','N',5,'en',0,0,'((35641X37X1030.NAOK == \"NO\" or 35641X37X1030.NAOK == \"YES\"))'),(1034,0,35641,37,'X','CLS_END_CCHS_TRM','','','','N','N',6,'en',0,0,'((35641X37X1030.NAOK == \"NO\" or 35641X37X1030.NAOK == \"YES\"))'),(1028,0,35641,37,'L','CLS_PROXY_CCHS_TRM','<b>Voilà qui termine l’entrevue principale. Mais, avant de vous quitter, j’aurais encore quelques questions pour vous.<br />\r\n<br />\r\nAujourd’hui, nous aimerions vous demander si vous pouviez choisir une personne qui agirait comme votre mandataire pour les entrevues si un jour vous n’êtes plus en mesure de répondre aux questions de l’intervieweur par vous-même? </b>','','<p>\r\n	<strong>NOTE À L’INTERVIEWEUR : Un mandataire est une personne légalement mandatée ou une autre personne qui peut prendre des décisions pour quelqu’un si la personne ne peut plus prendre ses décisions un jour.</strong></p>\r\n','N','Y',0,'fr',0,0,'((TOKEN:ATTRIBUTE_1 >= \"70\"))'),(1029,0,35641,37,'L','CLS_PROXYPCK_CCHS_TRM','Merci beaucoup. Veuillez remplir le formulaire de consentement pour designer un mandataire qui se trouve dans la trousse que nous vous avons fait parvenir et retournez-le dans l’enveloppe préadressée et préaffranchie, également dans la trousse. ','','<strong>INTERVIEWEUR – DEMANDER AU PARTICIPANT DE CONFIRMER QU’IL A TOUJOURS EN SA POSSESSION LA TROUSSE D’INFORMATION POUR DÉSIGNER UN MANDATAIRE</strong>','N','Y',1,'fr',0,0,'((TOKEN:ATTRIBUTE_1 >= \"70\") and (35641X37X1028.NAOK == \"YES\"))'),(1030,0,35641,37,'L','CLS_SECADD_CCHS_TRM','<script type=\"text/javascript\" charset=\"utf-8\">\r\n\r\n  \r\n          var a = \"{TOKEN:ATTRIBUTE_1}\";\r\n          var b = parseInt(a);\r\n          if (b < 70){\r\n            document.write(\"<b>\");\r\n            document.write(\"Voilà qui termine l’entrevue principale. \");\r\n            document.write(\"Mais, avant de vous quitter, j’aurais encore quelques questions pour vous... \")\r\n            document.write(\"</b>\");\r\n            document.write(\"<br />\");\r\n            document.write(\"<br />\");\r\n          }\r\n        \r\n    \r\n\r\n</script>\r\n<p>\r\n	Certains de nos participants ont une résidence secondaire dans laquelle ils vivent l’été ou l’hiver. Nous aimerions connaître les coordonnées de ces résidences secondaires pour pouvoir correspondre avec vous ou vous joindre pour des entrevues de suivi en tout temps.                          </p>\r\n<p>\r\n	 </p>\r\n<p>\r\n	Possédez-vous une résidence secondaire pour laquelle vous voudriez nous donner l’adresse?</p>\r\n','','','N','Y',2,'fr',0,0,'((35641X37X1028.NAOK == \"NO\")) or ((35641X37X1029.NAOK == \"NOTREQUIRESNEWPROXYPACKAGE\" or 35641X37X1029.NAOK == \"REQUIRESNEWPROXYPACKAGE\")) or (((!is_empty(TOKEN:ATTRIBUTE_1) && (TOKEN:ATTRIBUTE